using System.Collections.Generic;
using System.Linq;
using Widgets.Data.Models;

namespace Widgets.Data
{
    public class WidgetRepository
    {
        private IEnumerable<Widget> Widgets = new List<Widget>()
        {
            new Widget { WidgetId = 1, WidgetName = "Beetle", Qty = 25, WidgetImage = "data:image/jpeg;base64,"},
            new Widget { WidgetId = 2, WidgetName = "Bus", Qty = 17, WidgetImage = "data:image/jpeg;base64,"},
            new Widget { WidgetId = 3, WidgetName ="Plane", Qty = 2, WidgetImage = "data:image/jpeg;base64,"},
            new Widget { WidgetId = 4, WidgetName ="Skelly", Qty = 42, WidgetImage = "data:image/jpeg;base64,"},
            new Widget { WidgetId = 5, WidgetName ="Top", Qty = 19, WidgetImage = "data:image/jpeg;base64,"}
        };

        public IEnumerable<Widget> GetAll() => Widgets;

        public Widget GetWidgetById(int widgetId)
        {
            // Log for debugging purposes
            System.Diagnostics.Debug.WriteLine($"Getting Widget by ID: {widgetId}");

            // Ensure Widgets is not null before calling FirstOrDefault
            if (Widgets != null)
            {
                Widget widget = Widgets.FirstOrDefault(w => w.WidgetId == widgetId);

                // Log the retrieved widget for debugging purposes
                System.Diagnostics.Debug.WriteLine($"Retrieved Widget: {widget}");

                return widget;
            }

            // Log the case where Widgets is null
            System.Diagnostics.Debug.WriteLine("Warning: Widgets collection is null.");

            // Handle the case where Widgets is null (you might return null or throw an exception)
            return null;
        }

    }
}
